import './HomePage.css';
import items from './items.json';

function HomePage() {
  return (
    <div className="HomePage">
      <div className="boxes">
        {items.map( response => {
          return(
            <div className="box" key={response.name}>
                <img src={response.picture} alt={response.name}/>
                <h1>{response.name}</h1>
                <h2>{response.price}</h2>
            </div>
          )
        })}
      </div>
    </div>
  );
}

export default HomePage;
